interface Movie {
  poster?: string;
  title: string;
  crawl: string;
  date: string;
}

const Movie: React.FC<Movie> = ({ poster, title, crawl, date }) => {
  return (
    <div className="movie__card">
      <img src={poster} alt="Movie Poster" />
      <span>{title}</span>
      <span>{crawl}</span>
      <span>{date}</span>
    </div>
  );
};

export default Movie;
